import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import './App.css';
import './nature-theme.css';
import leafLeft from './assets/leaf-left.svg';
import leafRight from './assets/leaf-right.svg';
import { ThemeProvider } from './contexts/ThemeContext';
import ThemeToggle from './components/ThemeToggle';

// Pages
import Home from './components/Home';
import Quiz from './components/Quiz';
import About from './components/About';
import PlantDetail from './components/PlantDetail';

function App() {
  return (
    <ThemeProvider>
      <Router>
        <div className="App min-h-screen pb-24 px-4 mx-auto">
          <div className="leaf-border-left">
            <img src={leafLeft} alt="" className="leaf-left-decoration" />
            <img src={leafLeft} alt="" className="leaf-left-decoration" />
            <img src={leafLeft} alt="" className="leaf-left-decoration" />
            <img src={leafLeft} alt="" className="leaf-left-decoration" />
            <img src={leafLeft} alt="" className="leaf-left-decoration" />
          </div>
          <div className="leaf-border-right">
            <img src={leafRight} alt="" className="leaf-right-decoration" />
            <img src={leafRight} alt="" className="leaf-right-decoration" />
            <img src={leafRight} alt="" className="leaf-right-decoration" />
            <img src={leafRight} alt="" className="leaf-right-decoration" />
            <img src={leafRight} alt="" className="leaf-right-decoration" />
          </div>

          <header>
            <ThemeToggle />
            <div className="container mx-auto">
              <h1 className="text-2xl font-heading text-center text-white">
                <span className="inline-block mr-2">üåø</span>
                Nature Explorer
              </h1>
              <p className="text-center text-white/80 text-sm mt-1 font-body">
                Discover the amazing plants of India
              </p>
            </div>
          </header>

          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/plant/:id" element={<PlantDetail />} />
            <Route path="/quiz" element={<Quiz />} />
            <Route path="/about" element={<About />} />
          </Routes>

          <BottomNavigation />
        </div>
      </Router>
    </ThemeProvider>
  );
}

function BottomNavigation() {
  const location = useLocation();

  return (
    <nav className="bottom-nav">
      <Link to="/" className={`nav-item ${location.pathname === '/' ? 'active-nav' : ''}`}>
        <span className="text-xl">üåø</span>
        <span className="text-xs font-body">Home</span>
      </Link>
      <Link to="/quiz" className={`nav-item ${location.pathname === '/quiz' ? 'active-nav' : ''}`}>
        <span className="text-xl">üß†</span>
        <span className="text-xs font-body">Quiz</span>
      </Link>
      <Link to="/about" className={`nav-item ${location.pathname === '/about' ? 'active-nav' : ''}`}>
        <span className="text-xl">‚ÑπÔ∏è</span>
        <span className="text-xs font-body">About</span>
      </Link>
    </nav>
  );
}

export default App;
